
using System.Reflection;
using TheSideChicks.Controllers;

namespace TheSideChicksTests.ControllerTests
{
    public class ControllerTests
    {

        private ImageController _sut = new ImageController();
        private readonly string base64FromSidechicksPng = "";
        private readonly string testDir = "Temp\\test\\sidechicks.png.png";

        [Fact]
        public async Task TestPhotoToBase64()
        {
            var locationPath = Path.GetDirectoryName(Assembly.GetExecutingAssembly().Location) + @"\..\..\..\Resources\Images\sidechicks.PNG";
            var base64string = await _sut.ToBase64Photo(locationPath);

            Assert.Equal(base64FromSidechicksPng, base64string);
        }
        [Fact]
        public async Task TestPhotoFromBase64()
        {
            
            var locationPath = await _sut.FromBase64Photo(base64FromSidechicksPng,"test","sidechicks.png");

            Assert.EndsWith(testDir, locationPath);
        }




    }
}